import Link from 'next/link';
import Layout from '../components/Layout';

export const about = () => {
    return (
        <>
            <Layout>

                <h1>This is the about page!</h1>
                <Link href='/'><a>Home Page</a></Link>
            </Layout>
        </>
    );
}

export default about;
